import React, { useState, useRef, useCallback } from 'react';
import ReactMapGL, { Source, Layer } from 'react-map-gl';
import 'mapbox-gl/dist/mapbox-gl.css';
import { calculateCosts, aggregateTotals, filterDataByArea, adjustCounts } from '../utils/costCalculations';

const MapComponent = ({ collisionData, onResultsUpdate }) => {
  const [viewport, setViewport] = useState({
    latitude: 52.1332,
    longitude: -106.6700,
    zoom: 11,
    bearing: 0,
    pitch: 0
  });

  const [firstCorner, setFirstCorner] = useState(null);
  const [previewArea, setPreviewArea] = useState(null);
  const [selectedArea, setSelectedArea] = useState(null);
  const mapRef = useRef(null);

  const handleMouseMove = useCallback((event) => {
    if (firstCorner) {
      const { lng, lat } = event.lngLat;
      
      const coordinates = [
        [
          [firstCorner.lng, firstCorner.lat],
          [firstCorner.lng, lat],
          [lng, lat],
          [lng, firstCorner.lat],
          [firstCorner.lng, firstCorner.lat],
        ],
      ];

      setPreviewArea({
        type: 'Polygon',
        coordinates,
      });
    }
  }, [firstCorner]);

  const handleFirstClick = useCallback((event) => {
    const { lngLat } = event;
    setFirstCorner(lngLat);
    setSelectedArea(null);
    setPreviewArea(null);
  }, []);

  const handleSecondClick = useCallback(
    (event) => {
      if (!firstCorner) return;
  
      const { lngLat } = event;
      const coordinates = [
        [
          [firstCorner.lng, firstCorner.lat],
          [firstCorner.lng, lngLat.lat],
          [lngLat.lng, lngLat.lat],
          [lngLat.lng, firstCorner.lat],
          [firstCorner.lng, firstCorner.lat],
        ],
      ];
  
      const newArea = {
        type: 'Polygon',
        coordinates,
      };
  
      setSelectedArea(newArea);
      setPreviewArea(null);
  
      const filteredData = filterDataByArea(collisionData, newArea);
  
      console.log("Filtered Data:", filteredData); // Log selected collision events
  
      const counts = {
        INJURY: filteredData.filter((row) => row.TYPE === 'INJURY').length,
        FATALITY: filteredData.filter((row) => row.TYPE === 'FATALITY').length,
        PROPERTY: filteredData.filter((row) => row.TYPE === 'PROPERTY').length,
      };
  
      console.log("Collision Counts:", counts); // Log the number of each type of collision
  
      const formattedData = [
        { TYPE: 'INJURY', count: counts.INJURY },
        { TYPE: 'FATALITY', count: counts.FATALITY },
        { TYPE: 'PROPERTY', count: counts.PROPERTY },
      ];
  
      const adjustedData = adjustCounts(formattedData);
      console.log("Adjusted Data:", adjustedData); // Log the adjusted counts
  
      const costData = calculateCosts(adjustedData);
      console.log("Cost Data:", costData); // Log the cost breakdown
  
      const { totals, yearly, daily } = aggregateTotals(costData);
      console.log("Totals:", totals);
      console.log("Yearly Costs:", yearly);
      console.log("Daily Costs:", daily);
  
      onResultsUpdate({ totals, yearly, daily });
      setFirstCorner(null);
    },
    [firstCorner, collisionData, onResultsUpdate]
  );
  

  const handleMapClick = useCallback(
    (event) => {
      if (!firstCorner) {
        handleFirstClick(event);
      } else {
        handleSecondClick(event);
      }
    },
    [firstCorner, handleFirstClick, handleSecondClick]
  );

  return (
    <ReactMapGL
      {...viewport}
      width="100%"
      height="100%"
      ref={mapRef}
      mapboxAccessToken={process.env.REACT_APP_MAPBOX_TOKEN}
      onMove={evt => setViewport(evt.viewport)}
      onClick={handleMapClick}
      onMouseMove={handleMouseMove}
      mapStyle="mapbox://styles/mapbox/streets-v11"
    >
      {/* Show preview area while moving mouse */}
      {previewArea && (
        <Source type="geojson" data={{ type: 'Feature', geometry: previewArea }}>
          <Layer
            id="preview-area"
            type="fill"
            paint={{
              'fill-color': '#3FB1CE',
              'fill-opacity': 0.2,
            }}
          />
          <Layer
            id="preview-outline"
            type="line"
            paint={{
              'line-color': '#3FB1CE',
              'line-width': 1,
              'line-dasharray': [2, 2],
            }}
          />
        </Source>
      )}

      {/* Show selected area after second click */}
      {selectedArea && (
        <Source type="geojson" data={{ type: 'Feature', geometry: selectedArea }}>
          <Layer
            id="selected-area"
            type="fill"
            paint={{
              'fill-color': '#3FB1CE',
              'fill-opacity': 0.5,
            }}
          />
          <Layer
            id="selected-area-outline"
            type="line"
            paint={{
              'line-color': '#3FB1CE',
              'line-width': 2,
            }}
          />
        </Source>
      )}
    </ReactMapGL>
  );
};

export default MapComponent;
